import React from 'react';

class SplashEmail extends React.Component {
	render() {
		return(
			<form className="gridSingleVert">
				<label className="white marginBottomHalf">Email</label>
				<input className="splashInput roundedCorners marginBottom" type="email" placeholder="Email*" />
				<input className="primaryButton roundedCorners" type="submit" value="Join Us" />
				<button className=" secondaryButton">Continue to Site</button>
			</form>
		);
	}
}

export default SplashEmail;
